import { Routes, Route, Outlet } from 'react-router-dom';
import Home from './routes/home/home.component';

const Navigation = () => (
  <div>
    <div>
      <h1>I am the navigation</h1>
    </div>
  </div>
);

const Shop = () => (<h1>I am the shop page</h1>);

const App = () => (
  <Routes>
    <Route path="/" element={<Home />} />
    <Route />
  </Routes>
);

export default App;
